        <div class="col-sm-4 col-sm-offset-1" style="margin-top: 10%;">
            <form style="text-align: center;" target="none">
                <h2>
                    TimeLLA
                    <small>
                        Lycée Louis ARMAND, Nogent-sur-Marne
                    </small>
                </h2>
                <hr/>
                <button type="button" class="tertiary" id="b1926">1926</button>
                <button type="button" class="tertiary" id="b1953">1953</button>
                <button type="button" class="tertiary" id="b1958">1958</button>
                <button type="button" class="tertiary" id="b1962">1962</button>
                <button type="button" class="tertiary" id="b1968">1968</button>
                <button type="button" class="tertiary" id="b1969">1969</button>
                <button type="button" class="tertiary" id="b1980">1980</button>
                <button type="button" class="tertiary" id="b1985">1985</button>
                <button type="button" class="tertiary" id="b1996">1996</button>
                <button type="button" class="tertiary" id="b2011">2011</button>
                <button type="button" class="tertiary" id="b202">202.</button>
                <br/>
                <progress id="play_stop" value="0" max="15" class="tertiary"></progress>
                <hr/>
                <sub>Pierre LAURENT, 16/02/22</sub>
                <br/>
                <sub><mark>Archives photographiques issues de l'IGN</mark></sub>
            </form>
        </div>
	</div>
    <script>
        const photos = [1926, 1953, 1958, 1962, 1968, 1969, 1980, 1985, 1996, 2011, 202];
        const date_nb = photos.length;

        function Date_click(){
            let date = this.id.substring(1);
            if(this.className == "tertiary"){
                this.className = "inverse";
                document.getElementById("a" + date).style.display = "none";
            }
            else{
                this.className = "tertiary";
                document.getElementById("a" + date).style.display = "inline";
            }
        }
        for(let tour = 0; tour < date_nb; tour++){
            document.getElementById("b" + photos[tour]).addEventListener("click", Date_click);
        }

        var play = true;
        function Play_stop_click(){
            if(this.className == "tertiary"){
                this.className = "secondary";
                play = false;
            }
            else{
                this.className = "tertiary";
                play = true;
            }
        }
        function Play(){
            if(play){
                let bar = document.getElementById("play_stop");
                if(bar.value == bar.max){
                    bar.value = 0;
                }
                for(let tour = 0; tour < date_nb; tour++){
                    if(tour > bar.value){
                        document.getElementById("b" + photos[tour]).className = "inverse";
                        document.getElementById("a" + photos[tour]).style.display = "none";
                    }
                    else{
                        document.getElementById("b" + photos[tour]).className = "tertiary";
                        document.getElementById("a" + photos[tour]).style.display = "inline";
                    }
                }
                bar.value++;
            }
            setTimeout(Play, 2500);
        }
        document.getElementById("play_stop").addEventListener("click", Play_stop_click);
        document.getElementById("play_stop").max = date_nb;
        Play();
    </script>
